import {AfterViewInit, Component, OnInit} from '@angular/core';
import {ClientService, Order} from "../client.service";
import {interval} from "rxjs";

@Component({
  selector: 'app-order-status',
  templateUrl: './order-status.component.html',
  styleUrls: ['./order-status.component.scss']
})
export class OrderStatusComponent implements OnInit, AfterViewInit {
  order: Order;
  statusCode = ['confirmed','accepted','baking','pizzaReady','delivering','pizzaDelivered','finished'];
  statusView = ['Confirmed','Accepted','Baking','Pizza Ready','Delivering','Delivered','Finished'];

  constructor(
    private clientService: ClientService) { }

  ngOnInit(): void {
    this.assignOrder();
  }

  ngAfterViewInit(): void {
    this.assignOrder();
    this.updateOrder().then();
  }

  async updateOrder() {
    console.log('updateOrder accessed')
    let count = 1;
    let milliseconds = 20000;
    let sub = interval(milliseconds).subscribe(() => {
      console.log(milliseconds*count/1000+' seconds passed: Running \'updateOrder\' again with count='+count)
      count++;
      this.assignOrder();
      if (this.order.status=='finished') {
        sub.unsubscribe();
      }
    })
  }

  assignOrder () {
    this.clientService.getOrder()
      .subscribe((orderFetched: Order)=>{
        this.order = orderFetched;
      });
}

  onSubmit() { //todo: implement this in html
    this.clientService.changeClientTaskStatusAndRedirect('task_2');
  }
}
<app-client></app-client>


<div class="container-fluid">
  <!-- row 4x4x4-->
  <div class="row">
    <div class="col-md-4">
    </div>
    <div class="col-md-4">
      <p start>Your Order is accepted! Please follow the Status below:</p>
      <table class="table">
        <thead>
        <tr>
          <th scope="col">Order Id</th>
          <th scope="col">Client Name</th>
          <th scope="col">Delivery Address</th>
          <th scope="col">Order Time</th>
          <th scope="col">Paid online?</th>
          <th scope="col">Order Status</th>
        </tr>
        </thead>
        <tbody>
        <tr>
          <th scope="row">{{order.id | slice:0:8}}</th>
          <td>{{order.clientName}}</td>
          <td>{{order.address}}</td>
          <td>{{order.orderTime}}</td>
          <td>{{order.paid}}</td>
          <td>{{order.status | uppercase}}</td>
        </tbody>
      </table>
    </div>
    <div class="col-md-4">
    </div>
    <p></p>

    <div class="row">
      <div class="col-md-3">
      </div>
      <div class="col-md-6">
        <table class="table">
          <tbody>
          <tr *ngFor="let status of statusCode">
            <th><p>{{statusView[statusCode.indexOf(status)]}}</p><img *ngIf="order.status==status; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>
<!--            <th><p>Accepted</p><img *ngIf="order.status=='accepted'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
<!--            <th><p>Baking</p><img *ngIf="order.status=='baking'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
<!--            <th><p>Pizza Ready</p><img *ngIf="order.status=='pizzaReady'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
<!--            <th><p>Delivering</p><img *ngIf="order.status=='delivering'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
<!--            <th><p>Delivered</p><img *ngIf="order.status=='pizzaDelivered'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
<!--            <th><p>Finished </p><img *ngIf="order.status=='finished'; else pendingOrPassed" alt="Responsive image" class="img-fluid" src="assets/images/delivery-guy-in-bike.png"></th>-->
            <ng-template #current(status) [ngIf]="order.status">

            </ng-template>
          <ng-template #pendingOrPassed>
            <img alt="Responsive image" class="img-fluid" src="assets/images/pending-icon.png">
          </ng-template>
          </tr>
          </tbody>
        </table>
        <img alt="Responsive image" class="rounded mx-auto d-block" src="assets/images/track.png">
        <div class="col-md-3">
        </div>
    </div>

  </div>
    <!--          row 4x4x4-->
    <div class="row">
      <p></p>
      <div class="col-md-4"></div>
      <div class="col-md-2">
        <button [disabled]="order.status!='finished'" class="w-100 btn btn-lg btn-info" type="submit">End My Status Check</button>
      </div>
      <div class="col-md-2">
        <button class="w-100 btn btn-lg btn-secondary" [routerLink]="['/client']" skipLocationChange="true" >Back</button>
      </div>
      <div class="col-md-4"></div>
    </div>
    <p></p>
</div>
</div>
